  false,\n\t\"url\": null,\n\t\"notes\": \"In 1984, the U.S. Geological Survey (USGS),
  Office of Marine Geology, launched a program using the Geological LOng-Range Inclined
  Asdic (GLORIA) sidescan-sonar system to study the entire U.S. Exclusive Economic
  Zone (EEZ). For a one month period beginning 24 February 1991 and finishing on 25
  March 1991, USGS and IOS (Institute of Oceanographic Sciences, U.K.) scientists
  conducted a single survey within the Kingman Reef and Palmyra Atoll U.S. EEZ. The
  survey focused on the U.S. Exclusive Economic Zone surrounding the Kingman Reef
  and Palmyra Atoll. Unfortunately, the southwestern third of this EEZ was not imaged.
  The results of this single survey were 7 digital mosaics with a 50-meter pixel resolution.\",\n\t\"license_title\":
